import { Link } from "react-router-dom";
import "./BodyCream.css";

const urls = [
  "/src/Image/bodycream1.jpg",
  "/src/Image/bodycream2.jpg",
  "/src/Image/bodycream3.jpg"
];

class BodyCream extends React.Component {
  renderImage(imageUrl) {
    return (
      <div>
        {console.log(imageUrl)}
        <img src={imageUrl} />
      </div>
    );
  }
  render() {
    return (
      <>
        <Link to="/">Go Home</Link>
        <div className="gallery">
          <div className="images">
            <img src={urls[0]} />
            {/* {urls.map(imageUrl => this.renderImage(imageUrl))} */}
          </div>
        </div>
      </>
    );
  }
}

export default BodyCream;
